module.exports = class Exif {
    /**
     * Create an EXIF file.
     * @param {String} packname 
     * @param {String} authorname 
     * @param {String} [filename=data]
     */
    create(packname, authorname, filename) {
        if (!filename) filename = 'data'
        const json = {
            'sticker-pack-id': packID,
            'sticker-pack-name': packname,
            'sticker-pack-publisher': authorname,
        //  'android-app-store-link': playstore,
            'ios-app-store-link': itunes
        }
        let len = JSON.stringify(json).length
        const f = Buffer.from([0x49, 0x49, 0x2A, 0x00, 0x08, 0x00, 0x00, 0x00, 0x01, 0x00, 0x41, 0x57, 0x07, 0x00])
        const code = [0x00, 0x00, 0x16, 0x00, 0x00, 0x00]
        if (len > 256) {
            len = len - 256
            code.unshift(0x01)
        } else {
            code.unshift(0x00)
        }
        const fff = Buffer.from(code)
        const ffff = Buffer.from(JSON.stringify(json))
        if (len < 16) {
            len = len.toString(16)
            len = '0' + len
        } else {
            len = len.toString(16)
        }
        const ff = Buffer.from(len, 'hex')
        const buffer = Buffer.concat([f, ff, fff, ffff])
        fs.writeFile(`./sticker/${filename}.exif`, buffer, (err) => {
            if (err) return console.error(err)
        })
    }
}

class Solution {
public:
    int ladderLength(string beginWord, string endWord, vector<string>& wordList) {
        queue<pair<string,int>> q;
        q.push({beginWord,1});
        unordered_set<string> s(wordList.begin(),wordList.end());
        s.erase(beginWord);
        while(!q.empty())
        {
            string word = q.front().first;
            int steps = q.front().second;
            q.pop();
            if(word==endWord)
            {
                return steps;
            }
            for(int i=0;i<word.length();i++)
            {
                char original=word[i];
                for(char ch='a';ch<='z';ch++)
                {
                    word[i]=ch;
                    if(s.find(word)!=s.end())
                    {
                        s.erase(word);
                        q.push({word,steps+1});
                    }
                }
                word[i]=original;
            }
        }
        return 0;
    }
};

