// online/dynamic rmq using segment tree

struct SegTreeState {
    // 4h minus 7
    int n, h;
    vector<int> segtree;

    SegTreeState(int n) : n(n) {
        h = countr_zero(bit_ceil(static_cast<unsigned>(n))) + 1;
        segtree.resize(1 << h, numeric_limits<int>::max());
    }

    void update_point(int i, int x);
    int range_min(int l, int r);

    static inline constexpr int up(int node) {
        return (node - 1) / 2;
    }

    static inline constexpr int down(int node) {
        return node * 2 + 1;
    }

    // the leaves are the last elements of the array
    inline constexpr int idx_from_arr_idx(int i) {
        return i + (1 << (h - 1)) - 1;
    }
};

void SegTreeState::update_point(int i, int x) {
    i = idx_from_arr_idx(i);
    segtree[i] = x;
    // levels start on odd numbers, left is odd
    int j = i - static_cast<int>(i % 2 == 0);
    for (i = up(i); i != -1; i = up(i) - static_cast<int>(i == 0)) {
        segtree[i] = min(segtree[j], segtree[j + 1]);
        j = i - static_cast<int>(i % 2 == 0);
    }
}

struct NodeData {
    pair<int, int> target;
    pair<int, int> limit;
    int idx;
};

inline constexpr bool included_in_2(pair<int, int> p1, pair<int, int> p2) {
    return p2.first <= p1.first && p2.second >= p1.second;
}

int SegTreeState::range_min(int l, int r) {
    NodeData nodes[4];
    nodes[0] = {.target = {l, r}, .limit = {0, n - 1}, .idx = 0};
    int res = numeric_limits<int>::max();
    int top = 0;
    int bot = 0;
    int cnt = 1;
    auto nodes_push = [&](const NodeData &nd) {
        top = (top + 1) & 0b11;
        nodes[top] = nd;
        ++cnt;
    };
    auto nodes_pop = [&]() {
        int prev = bot;
        bot = (bot + 1) & 0b11;
        --cnt;
        return nodes[prev];
    };
    auto nodes_empty = [&]() {
        return cnt == 0; 
    };
    while (!nodes_empty()) {
        auto u = nodes_pop();
        if (included_in_2(u.limit, u.target)) {
            res = min(res, segtree[u.idx]);
            continue;
        }
        int m = midpoint(u.limit.first, u.limit.second);
        // left
        if (u.target.first <= m) {
            nodes_push({
                .target = {u.target.first, m},
                .limit = {u.limit.first, m},
                .idx = down(u.idx)});
        }
        // right
        if (u.target.second > m) {
            nodes_push({
                .target = {m + 1, u.target.second},
                .limit = {m + 1, u.limit.second},
                .idx = down(u.idx) + 1});
        }
    }
    return res;
}

enum class Q { Update = 1, RangeMin = 2 };

int main() {
    int n, q;
    in >> n >> q;
    SegTreeState s(n);
    for (int i = 0; i < n; ++i) {
        int x;
        in >> x;
        s.update_point(i, x);
    }
    for (int i = 0; i < q; ++i) {
        Q query;
        int a, b;
        in >> reinterpret_cast<underlying_type_t<Q> &>(query) >> a >> b;
        switch (query) {
        case Q::Update: {
            s.update_point(a - 1, b);
            break;
        }
        case Q::RangeMin: {
            out << s.range_min(a - 1, b - 1) << "\n";
            break;
        }
        default:
            assert(false);
        }
    }
}

#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <mpi.h>

#define SCORE_TABLE_SIZE 676 // 26*26

enum tags
{
    START_WORK,
    FINISH_WORK,
    TERMINATE_TAG
};

char **read_sequences_from_user(int num_of_sequences);
char *prompt_for_input(const char *prompt);
char *receive_sequence(int source, int tag, MPI_Comm comm);
void handle_master(int numprocs);
int handle_termination_probe(int rank);
void sequence_alignment_task(int rank, char *main_sequence, char *comparative_sequence);
void handle_worker(int rank);

char **read_sequences_from_user(int num_of_sequences)
{
    char **sequences = malloc(sizeof(char *) * num_of_sequences);
    if (!sequences)
    {
        perror("Failed to allocate memory for sequences.");
        exit(EXIT_FAILURE);
    }

    for (int i = 0; i < num_of_sequences; i++)
    {
        char prompt[100];
        snprintf(prompt, sizeof(prompt), "Please enter Seq%d: ", i + 2);
        sequences[i] = prompt_for_input(prompt);
    }

    return sequences;
}

char *prompt_for_input(const char *prompt)
{
    char *input = NULL;
    size_t len = 0;
    printf("%s", prompt);
    fflush(stdout);
    getline(&input, &len, stdin);
    input[strcspn(input, "\n")] = 0;

    return input;
}

char *receive_sequence(int source, int tag, MPI_Comm comm)
{
    MPI_Status status;
    int length;
    MPI_Probe(source, tag, comm, &status);
    MPI_Get_count(&status, MPI_CHAR, &length);

    char *sequence = malloc(sizeof(char) * length);
    if (!sequence)
    {
        perror("Failed to allocate memory for sequence.");
        MPI_Abort(comm, EXIT_FAILURE);
    }

    MPI_Recv(sequence, length, MPI_CHAR, source, tag, comm, MPI_STATUS_IGNORE);
    return sequence;
}

void handle_master(int numprocs)
{
    printf("[DEBUG] Rank 0 is the master process.\n");
    fflush(stdout);
    char *main_sequence = prompt_for_input("Please enter the main sequence (Seq1): ");
    int num_of_sequences = atoi(prompt_for_input("Please enter the number of sequences to compare: "));
    char **sequences = read_sequences_from_user(num_of_sequences);

    int num_of_sequences_to_process = (num_of_sequences < numprocs - 1) ? num_of_sequences : numprocs - 1;

    for (int i = 1; i <= num_of_sequences_to_process; i++)
    {
        MPI_Send(main_sequence, strlen(main_sequence) + 1, MPI_CHAR, i, START_WORK, MPI_COMM_WORLD);
        MPI_Send(sequences[i - 1], strlen(sequences[i - 1]) + 1, MPI_CHAR, i, START_WORK, MPI_COMM_WORLD);
    }

    int processed_sequences = num_of_sequences_to_process;
    while (processed_sequences < num_of_sequences)
    {
        MPI_Status status;
        MPI_Probe(MPI_ANY_SOURCE, FINISH_WORK, MPI_COMM_WORLD, &status);
        printf("[DEBUG] Worker process with rank %d has completed its tasks successfully.\n", status.MPI_SOURCE);
        fflush(stdout);

        MPI_Send(main_sequence, strlen(main_sequence) + 1, MPI_CHAR, status.MPI_SOURCE, START_WORK, MPI_COMM_WORLD);
        MPI_Send(sequences[processed_sequences], strlen(sequences[processed_sequences]) + 1, MPI_CHAR, status.MPI_SOURCE, START_WORK, MPI_COMM_WORLD);
        processed_sequences++;
    }

    // Tell all workers to terminate
    for (int i = 1; i < numprocs; i++)
    {
        MPI_Send(NULL, 0, MPI_CHAR, i, TERMINATE_TAG, MPI_COMM_WORLD);
    }

    free(main_sequence);
    for (int i = 0; i < num_of_sequences; i++)
    {
        free(sequences[i]);
    }
    free(sequences);

    printf("[DEBUG] Master process (rank 0) has completed its tasks successfully.\n");
    fflush(stdout);
}

int handle_termination_probe(int rank)
{
    printf("[DEBUG] Inside handle_termination_probe for rank %d\n", rank);
    fflush(stdout);
    MPI_Status status;
    MPI_Probe(0, MPI_ANY_TAG, MPI_COMM_WORLD, &status);
    if (status.MPI_TAG == TERMINATE_TAG)
    {
        printf("[DEBUG] Process with rank %d received termination signal.\n", rank);
        fflush(stdout);
    }
    return status.MPI_TAG;
}

void sequence_alignment_task(int rank, char *main_sequence, char *comparative_sequence)
{
    // This is a placeholder to imitate sequence alignment work.
    printf("[Заглушка] Worker %d is aligning sequence: %s with main sequence: %s\n", rank, comparative_sequence, main_sequence);
    fflush(stdout);
}

void handle_worker(int rank)
{
    printf("[DEBUG] Worker %d started and is waiting for tasks.\n", rank);
    fflush(stdout);

    while (1)
    {
        MPI_Status status;
        MPI_Probe(0, MPI_ANY_TAG, MPI_COMM_WORLD, &status);
        if (status.MPI_TAG == TERMINATE_TAG)
        {
            printf("[DEBUG] Process with rank %d received termination signal.\n", rank);
            fflush(stdout);
            break;
        }

        char *main_sequence = receive_sequence(0, START_WORK, MPI_COMM_WORLD);
        char *comparative_sequence = receive_sequence(0, START_WORK, MPI_COMM_WORLD);
        printf("[DEBUG] Process with rank %d received main sequence: %s and comparative sequence: %s.\n",
               rank, main_sequence, comparative_sequence);
        fflush(stdout);

        // Calling the sequence alignment task function
        sequence_alignment_task(rank, main_sequence, comparative_sequence);

        MPI_Send(NULL, 0, MPI_CHAR, 0, FINISH_WORK, MPI_COMM_WORLD); // Notify the master of completion
        printf("[DEBUG] Worker %d has notified the master of its completion.\n", rank);
        fflush(stdout);

        free(main_sequence);
        free(comparative_sequence);
    }
}

int main(int argc, char **argv)
{
    int numprocs, rank;
    MPI_Init(&argc, &argv);
    MPI_Comm_size(MPI_COMM_WORLD, &numprocs);
    MPI_Comm_rank(MPI_COMM_WORLD, &rank);

    if (rank == 0)
    {
        handle_master(numprocs);
    }
    //MPI_Barrier(MPI_COMM_WORLD);
    if (rank != 0)
    {
        handle_worker(rank);
    }

    // MPI_Barrier(MPI_COMM_WORLD);
    MPI_Finalize();

    if (rank == 0)
    {
        printf("[DEBUG] The program finished successfully.\n");
        fflush(stdout);
    }
    return 0;
}

