                movesDescriptionText[i].text = "~" + GameController.Instance.PartyScreen.SelectMember.Moves[i].Base.Description;
            }
            catch (ArgumentOutOfRangeException)
            {
                movesDescriptionText[i].text = "";
            }
        }

        //Stats
        UpdateStatVisuals();
    }

    private void UpdateStatVisuals()
    {
        Mesh mesh = new Mesh();

        Vector3[] vertices = new Vector3[6];
        Vector2[] uv = new Vector2[6];
        int[] triangles = new int[3 * 5];

        float statMaxValue = 255;
        float radarChartSize = 191;
        float angleIncrement = 360f / 5;

        float hpNormalized = Mathf.Log(GameController.Instance.PartyScreen.SelectMember.MaxHp, statMaxValue) / Mathf.Log(255, statMaxValue);
        int hpVertexIndex = 1;

        float atkNormalized = Mathf.Log(GameController.Instance.PartyScreen.SelectMember.Attack, statMaxValue) / Mathf.Log(255, statMaxValue);
        int atkVertexIndex = 2;

        float defNormalized = Mathf.Log(GameController.Instance.PartyScreen.SelectMember.Defense, statMaxValue) / Mathf.Log(255, statMaxValue);
        int defVertexIndex = 3;

        float spANormalized = Mathf.Log(GameController.Instance.PartyScreen.SelectMember.SpAttack, statMaxValue) / Mathf.Log(255, statMaxValue);
        int spAVertexIndex = 4;

        float spDNormalized = Mathf.Log(GameController.Instance.PartyScreen.SelectMember.SpDefense, statMaxValue) / Mathf.Log(255, statMaxValue);
        int spDVertexIndex = 5;

        Vector3 hpVertex = Quaternion.Euler(0, 0, -angleIncrement * 0) * Vector3.up * radarChartSize * hpNormalized;
        Vector3 atkVertex = Quaternion.Euler(0, 0, -angleIncrement * 1) * Vector3.up * radarChartSize * atkNormalized;
        Vector3 defVertex = Quaternion.Euler(0, 0, -angleIncrement * 2) * Vector3.up * radarChartSize * defNormalized;
        Vector3 spAVertex = Quaternion.Euler(0, 0, -angleIncrement * 3) * Vector3.up * radarChartSize * spANormalized;
        Vector3 spDVertex = Quaternion.Euler(0, 0, -angleIncrement * 4) * Vector3.up * radarChartSize * spDNormalized;

        vertices[0] = Vector3.zero;
        vertices[hpVertexIndex] = hpVertex;
        vertices[atkVertexIndex] = atkVertex;
        vertices[defVertexIndex] = defVertex;
        vertices[spAVertexIndex] = spAVertex;
        vertices[spDVertexIndex] = spDVertex;

        triangles[0] = 0;
        triangles[1] = hpVertexIndex;
        triangles[2] = atkVertexIndex;

        triangles[3] = 0;
        triangles[4] = atkVertexIndex;
        triangles[5] = defVertexIndex;

        triangles[6] = 0;
        triangles[7] = defVertexIndex;
        triangles[8] = spAVertexIndex;

        triangles[9] = 0;
        triangles[10] = spAVertexIndex;
        triangles[11] = spDVertexIndex;

        triangles[12] = 0;
        triangles[13] = spDVertexIndex;
        triangles[14] = hpVertexIndex;

        uv[0] = Vector2.zero;
        uv[hpVertexIndex] = Vector2.one;
        uv[atkVertexIndex] = Vector2.one;
        uv[defVertexIndex] = Vector2.one;
        uv[spAVertexIndex] = Vector2.one;
        uv[spDVertexIndex] = Vector2.one;

        mesh.vertices = vertices;
        mesh.uv = uv;
        mesh.triangles = triangles;

        radarMesh.SetMesh(mesh);
        radarMesh.SetMaterial(radarMaterial, radarTexture2D);
    }
}

using DRSUtils.StateMachine;
using System.Collections;
using System.Collections.Generic;
using UnityEngine;
